import {ReactComponent as Journey} from '../assets/Icon exports/Our journey.svg';
import {ReactComponent as BackgroundJourney} from '../assets/Icon exports/journey.svg';
export const Our_Clients = (props) => {
  return (
    <div id='our_clients' className='text-center'>
      <div className='container'>
        <div className='section-title'>
          <h2> Our Premium Clients</h2>
          <img src="./img/premium_clients.png" className="img-responsive" alt="" />{" "}
          <h2>Our Journey</h2>
          <div className= 'front-journey '> 
            <img src="./img/frontjourney.png" className="img-responsive" alt="" />{" "} 
              <div className = 'background-journey'>
              <img src="./img/journey.png" className="img-responsive" alt="" />{" "} 
          </div>
          </div>
         
        </div>
       
      </div>
    </div>
  )
}
